import styles from "./Books.module.css";
function Books() {
  return (
    <div className={styles.books}>
      <div className={styles.books1}></div>
      <div className={styles.books2}></div>
      <div className={styles.books3}></div>
      <div className={styles.books4}></div>
      <div className={styles.books5}></div>
      <div className={styles.books6}></div>
      <div className={styles.books7}></div>
      <div className={styles.books8}></div>
    </div>
  );
}
export default Books;
